Console.WriteLine("Hello, World!");

var sequence = new List<char>("".ToCharArray());
var marker_length = 14;

for(int i = marker_length ; i < sequence.Count(); i ++)
{
    Console.WriteLine($"{i}: {new string(sequence.GetRange(i-marker_length, marker_length).ToArray())} | {new string(sequence.GetRange(i-marker_length, marker_length).Distinct().ToArray())}");
    
    // build subsequence
    if (sequence.GetRange(i-marker_length, marker_length).Distinct().Count()==marker_length)
    {
        Console.WriteLine($"{i}");
        break;
    }
    
}
